import React from 'react'

export default function Lost() {
    return (
        <div style={{
            height: "100vh",
            display: "flex",
            alignItems: "center",
            alignContent: "center",
            justifyContent: "center",
            background: "radial-gradient(circle, #1f1f1f 40%, darkblue 40%, indigo 45%, #1f1f1f 45%)",
        }}>
            <h1 style={{
                color: "darkgrey",
                fontSize: "30px",
                margin: "0px",
                position: "absolute",
                top: "50%",
                left: "50%",
                transform: "translate(-50%, -50%)",
                fontWeight: "bold",
            }}>A  <span style={{
                color: "#3676ff",
            }}>life</span> was just <span style={{
                color: "#3676ff",
            }}>lost</span> because of  <span style={{
                color: "#3676ff",
            }}>social media </span><span style={{
                color: "indigo",
                fontSize: "15px",
            }}>and you...</span></h1>
        </div>
    )
}
